import Head from "next/head";
import React, { useState, useEffect } from "react";

function Page() {
  const [tal, setTal] = useState();

  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/posts/1")
      .then((response) => response.json())
      .then((json) => setTal(json));
  }, []);

  function deleteGet() {
    console.log("teste");
    fetch("https://jsonplaceholder.typicode.com/posts/1", {
      method: "DELETE",
    }).then((json) => setTal(json));
  }
  function Filtro1() {
    fetch("https://jsonplaceholder.typicode.com/posts?userId=1")
      .then((response) => response.json())
      .then((json) => setTal(json));
  }

  return (
    <>
      <Head>
        <title>Seja bem vindo</title>
      </Head>
      <div>
        <>
          <button
            onClick={() => {
              Filtro1();
            }}
          >
            Filtro 1
          </button>
          <button
            onClick={() => {
              deleteGet();
            }}
          >
            Delete
          </button>
          <br></br>
          {tal && (
            <div className="teste">
              {tal.map((post) => {
                return (
                  <>
                    <span>{post.id}</span>

                    <br />
                  </>
                );
              })}
            </div>
          )}
          {!tal && (
            <div className="teste">
              <>
                <span>sem dados</span>
              </>
            </div>
          )}
        </>
      </div>
    </>
  );
}
Page.getInitialProps = async () => {
  return {};
};
export default Page;
